//imports
import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const Navbar = () => {
    return(
    <NavbarContainer>
        <div className='logo'>
        <Link to="/">EMPTY YOUR FRIDGE</Link>
        </div>
        
        <div className='links'>
        <Link to="/recipes">Recpies</Link>
        <Link to="/favorites">Fav</Link>
        </div>
    </NavbarContainer>
    )
};

export default Navbar;

const NavbarContainer = styled.div`
width: 100%;
height: 100px;
position: fixed;
background: #161717;
display: flex;
z-index: 100;
.links {
    display: flex;
    align-items: center;
    font-family: "Kranky", serif;
font-weight: 400;
font-style: normal;
float: right;
padding: 15px;
a {
    color: white;
    text-decoration: none;
    margin: 0 15px;
    font-size: 32px;
    }
&:hover {
    border:2px dashed white;
    border-radius: 5px;
    }
}
`;

const Title = styled.div`
font-family: "Kranky", serif;
font-weight: 400;
font-size: 60px;
float: left;
text-align: center;
padding: 14px 16px;
`;
